Class Precos {

    public static function price_formato($categories_id) {
        $formato_id = CategoryFormato::where('categories_id', $categories_id)
                ->lists('formato_id');

        //id e formato_id
        foreach ($formato_id as $k => $valor) {
            $formato = Formato::find($valor)->valor;
            echo '<p class="preco-radio" id="opcao-formato' . $valor . '">' . "\n";
            echo '<input type="radio" name="formato" id="formato' . $valor . '" onclick="LimpaForm(this,\'formato\');"  onmouseover="MudaCor(this,' . $valor . ');" onmouseout="RetornaCor(this,' . $valor . ');"  value="' . $valor . '" />' . "\n";
            echo '<span class="preco-atributo">' . $formato . '</span></p>' . "\n";
        }
    }

    public static function price_papel($categories_id) {
        $papel_id = CategoryPapel::where('categories_id', $categories_id)
                ->lists('papel_id');
        //id e formato_id
        foreach ($papel_id as $k => $valor) {
            $papel = Papel::find($valor)->valor;
            echo '<p class="preco-radio" id="opcao-papel' . $valor . '">' . "\n";
            echo '<input type="radio" name="papel" id="papel' . $valor . '" onclick="LimpaForm(this,\'papel\');"  onmouseover="MudaCor(this,' . $valor . ');" onmouseout="RetornaCor(this,' . $valor . ');"  value="' . $valor . '" />' . "\n";
            echo '<span class="preco-atributo">' . $papel . '</span></p>' . "\n";
        }
    }

    public static function price_acabamento($categories_id) {
        $acabamento_id = CategoryAcabamento::where('categories_id', $categories_id)
                ->lists('acabamento_id');
        //id e formato_id
        foreach ($acabamento_id as $k => $valor) {
            $acabamento = Acabamento::find($valor)->valor;
            echo '<p class="preco-radio" id="opcao-acabamento' . $valor . '">' . "\n";
            echo '<input type="radio" name="acabamento" id="acabamento' . $valor . '" onclick="ConfiguraPacote(this.id, ' . $categories_id . ',' . $valor . ')"  onmouseover="MudaCor(this,' . $valor . ');" onmouseout="RetornaCor(this,' . $valor . ');"  value="' . $valor . '" />' . "\n";
            echo '<span class="preco-atributo">' . $acabamento . '</span></p>' . "\n";
        }
    }

    public static function qtd($categories_id) {
        $pacotes = Pacote::where('categories_id', $categories_id)->get();
        $path = explode('/', Request::path());
        if ($path[0] == 'acabamento') {
            $disable = '';
        } else {
            $disable = 'disable';
        }
        foreach ($pacotes->toarray() as $k => $valor) {
            echo '<p class="preco-radio qtd" id="opcao-pacote' . $valor['id'] . '">' . "\n";
            echo '<input class="pull-left" type="radio" name="pacote" id="pacote' . $valor['id'] . '" onclick="RadioHab(this, ' . $valor['id'] . ')"  onmouseover="MudaCor(this,' . $valor['id'] . ');" onmouseout="RetornaCor(this,' . $valor['id'] . ');" ' . $disable . ' value="' . $valor['quantity'] . '"  />';
            echo '<span class="preco-atributo pull-right">';
            echo '<span class="pull-left">';
            echo $valor['quantity'] . ' un.' . "\n";
            echo '</span>';
            echo '<span class="pull-right" id="pacote_' . $valor['id'] . '">' . "\n";
            echo '<span id="preco_' . $valor['quantity'] . '" style="display:none">' . "\n";
            echo '</span>' . "\n" . '</span></span>' . "\n" . '</p>' . "\n";
            echo '<div class="clearfix"></div>';
        }
    }

